import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './css/signup2.css';

export default function Signup2() {
    const [formData, setFormData] = useState({
        gender: '',
        age: '',
        height: '',
        user_weight: '',
        user_address: '',
        health_goal: ''
    });

    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setSuccess('');

        try {
            const userId = localStorage.getItem("user_id"); // ✅ 회원가입 시 저장된 user_id
            if (!userId) {
                setError("회원 ID가 유효하지 않습니다. 다시 로그인해주세요.");
                return;
            }

            const dataToSend = {
                ...formData,
                user_id: userId // ✅ user_id 추가
            };

            await axios.post('http://localhost:8080/users/details', dataToSend);

            setSuccess('건강 정보가 성공적으로 저장되었습니다!');
            setTimeout(() => {
                navigate('/main');
            }, 2000);
        } catch (err) {
            setError('정보 저장 실패: 다시 시도해주세요.');
            console.error(err);
        }
    };

    const handleAddressSearch = () => {
        new window.daum.Postcode({
            oncomplete: function (data) {
                const address = data.address;
                setFormData(prev => ({ ...prev, user_address: address }));
            }
        }).open();
    };

    return (
        <div className="container">
            <div className="text-center">
                <h1>추가 건강 정보 입력</h1>
            </div>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>성별</label>
                    <select name="gender" value={formData.gender} onChange={handleChange} className="form-control" required>
                        <option value="">선택하세요</option>
                        <option value="1">남성</option>
                        <option value="2">여성</option>
                    </select>
                </div>

                <div className="form-group">
                    <label>나이</label>
                    <input type="number" name="age" className="form-control" placeholder="예: 25" value={formData.age} onChange={handleChange} required />
                </div>

                <div className="form-group">
                    <label>키 (cm)</label>
                    <input type="number" name="height" className="form-control" placeholder="예: 170" value={formData.height} onChange={handleChange} required />
                </div>

                <div className="form-group">
                    <label>몸무게 (kg)</label>
                    <input type="number" name="user_weight" className="form-control" placeholder="예: 65" value={formData.user_weight} onChange={handleChange} required />
                </div>

                <div className="form-group">
                    <label>주소</label>
                    <input type="text" name="user_address" className="form-control" placeholder="주소를 검색해주세요" value={formData.user_address} readOnly />
                    <button type="button" className="btn btn-secondary mt-2" onClick={handleAddressSearch}>주소 검색</button>
                </div>

                <div className="form-group">
                    <label>건강 목표</label>
                    <select name="health_goal" value={formData.health_goal} onChange={handleChange} className="form-control" required>
                        <option value="">선택하세요</option>
                        <option value="1">체중 감량</option>
                        <option value="2">근육 강화</option>
                        <option value="3">건강한 생활 유지</option>
                    </select>
                </div>

                {error && <div className="error-message">{error}</div>}
                {success && <div className="success-message">{success}</div>}

                <button type="submit" className="btn btn-primary">제출하기</button>
            </form>
        </div>
    );
}
